import React from "react";
import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  // Logout function to clear login status and redirect to home
  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/");
  };

  // Function to navigate to Dashboard
  const goToDashboard = () => {
    navigate("/dashboard");  // Redirect to the Dashboard page
  };

  return (
    <nav className="backdrop-blur-lg bg-opacity-20 bg-black fixed top-0 w-full p-4 flex justify-between items-center shadow-lg z-50">
      {/* QuickRent Logo - Clicking on this will navigate to Dashboard */}
      <h1 className="text-3xl font-bold text-cyan-400 cursor-pointer" onClick={goToDashboard}>
        QuickRent
      </h1>

      <ul className="hidden md:flex space-x-6 text-white">
        {/* Navbar Links */}
        <li>
          <a href="#features" className="hover:text-cyan-400 transition">Features</a>
        </li>
        <li>
          <a href="#gadgets" className="hover:text-cyan-400 transition">Gadgets</a>
        </li>
        <li>
          <a href="#contact" className="hover:text-cyan-400 transition">Contact</a>
        </li>
      </ul>

      <button
        onClick={handleLogout}
        className="bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition"
      >
        Logout
      </button>
    </nav>
  );
};

export default Navbar;
